import { Link } from "react-router-dom";

const AnimeList = ({anime}) => {
    return ( 
        anime.map((ani) => (
            <div className="table-container">
                
                <tr>
                <Link to={`/anime/${ani.id}`} className="table-row-link">
                    <td className="table-cell">{ani.id}</td>
                    <td className="table-cell"><img src={ani.pic} alt={ani.title} /></td>
                    <td className="table-cell">{ani.title}</td>
                    <td className="table-cell">{ani.score}</td>
                </Link>
                </tr>
                
            </div>
        ))

     );
}
 
export default AnimeList;
